
'use strict';


var base64_samba = ''
var base64_down = ''



let currentPrice = null
let previousPrice = null
let priceDiff = 0

// datauri scheme 形式にして Audio オブジェクトを生成します
var sound_samba = new Audio("data:audio/mp3;base64," + base64_samba);
var sound_down = new Audio("data:audio/mp3;base64," + base64_down);




setInterval(() => {
    var request = new XMLHttpRequest();
    request.open('GET', 'https://api.bitflyer.jp/v1/ticker?product_code=BTC_JPY', true);
    request.responseType = 'json';



    request.onload = function () {
        var data = this.response;
        console.log(data.ltp);
        currentPrice = data.ltp
        if (previousPrice) {
            if (currentPrice > previousPrice) {
                priceDiff = currentPrice - previousPrice
                var synthes = new SpeechSynthesisUtterance(`プラス${priceDiff}円なり`)
                synthes.volume = 2
                synthes.onend = () => { sound_samba.play() }
                speechSynthesis.speak(
                    synthes
                );
                console.log('UP')

                sound_down.pause()
                previousPrice = data.ltp
            } else if (currentPrice < previousPrice) {
                priceDiff = previousPrice - currentPrice
                var synthes = new SpeechSynthesisUtterance(`マイナス${priceDiff}円なり`)
                synthes.volume = 2
                synthes.onend = () => { sound_down.play() }
                speechSynthesis.speak(
                    synthes
                );
                console.log('DOWN')


                sound_samba.pause();
                previousPrice = data.ltp
            } else {
                console.log('NO CHANGE')
            }
        } else {
            previousPrice = data.ltp
        }
    };

    request.send();
}, 2000)




